import PCAlogo from './icons/pca-logo.svg';
import { AppLayout, Header, Footer, Login as SignIn } from 'ui';

import PCASkinHero from './images/pcaSkinHero.png';
import FooterLogo from './images/SH_Footer_logo.png';
import Home from './components/Home';
import { NAV_ITEMS, FOOTER_COLS } from './constants';

function App() {
  return (
    <div className="App font-new-hero">
      <AppLayout
        header={<Header imgUrl={PCAlogo} navMenuItems={NAV_ITEMS} />}
        footer={<Footer footerCols={FOOTER_COLS} footerLogoUrl={FooterLogo} />}
        content={<Home heroImgUrl={PCASkinHero} Login={<SignIn />} />}
      />
    </div>
  );
}

export default App;

function Login() {
  return (
    <div className="h-96 w-full bg-slate-300">Login component placeholder</div>
  );
}
